import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';

function Step4(props) {

  return (
    <div className='quote'>
      <button onClick={() => props.history.push('/quote/step3')}>go back</button>
      <button onClick={() => props.history.push('./sidewalk')}>go to step 5</button>

    </div>
  );
}

export default connect()(withRouter(Step4));
